INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", "", 1, 0, 2, 0, 105901, 1, 0, 80003, "コッコロ", 121);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("え？　ちょっと\nいきなりなにっ？", "", 2, 0, 1, 0, 106001, 1, 0, 80003, "キャル", 122);
