INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", "", 0, 0, 2, 0, 105801, 1, 0, 80003, "ペコリーヌ", 124);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", "", 0, 0, 3, 0, 105801, 1, 0, 80003, "ペコリーヌ", 125);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", "", 1, 0, 3, 0, 105901, 1, 0, 80003, "コッコロ", 126);
