INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", "", 0, 0, 4, 0, 105801, 1, 0, 80003, "ペコリーヌ", 129);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", "", 2, 0, 4, 0, 106001, 1, 0, 80003, "キャル", 130);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", "", 1, 0, 5, 0, 105901, 1, 0, 80003, "コッコロ", 131);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", "", 0, 0, 5, 0, 106001, 2, 0, 80003, "キャル", 132);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", "", 1, 0, 1, 0, 190801, 2, 0, 80003, "カリン", 133);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", "", 0, 0, 6, 0, 106001, 2, 0, 80003, "キャル", 134);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", "", 1, 0, 2, 0, 190801, 2, 0, 80003, "カリン", 135);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", "", 0, 0, 7, 0, 106001, 2, 0, 80003, "キャル", 136);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", "", 1, 0, 3, 0, 190801, 2, 0, 80003, "カリン", 137);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", "", 0, 0, 8, 0, 106001, 2, 0, 80003, "キャル", 138);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", "", 0, 0, 9, 0, 106001, 2, 0, 80003, "キャル", 139);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", "", 1, 0, 4, 0, 190801, 2, 0, 80003, "カリン", 140);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", "", 0, 0, 10, 0, 106001, 2, 0, 80003, "キャル", 141);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", "", 1, 0, 5, 0, 190801, 2, 0, 80003, "カリン", 142);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", "", 0, 0, 11, 0, 106001, 2, 0, 80003, "キャル", 143);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", "", 0, 0, 6, 0, 105901, 3, 0, 80003, "コッコロ", 144);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", "", 1, 0, 5, 0, 105801, 3, 0, 80003, "ペコリーヌ", 145);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", "", 0, 0, 7, 0, 105901, 3, 0, 80003, "コッコロ", 146);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", "", 0, 0, 8, 0, 105901, 3, 0, 80003, "コッコロ", 147);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", "", 1, 0, 6, 0, 105801, 3, 0, 80003, "ペコリーヌ", 148);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", "", 1, 0, 7, 0, 105801, 3, 0, 80003, "ペコリーヌ", 149);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", "", 0, 0, 9, 0, 105901, 3, 0, 80003, "コッコロ", 150);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", "", 1, 0, 8, 0, 105801, 3, 0, 80003, "ペコリーヌ", 151);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", "", 0, 0, 10, 0, 105901, 3, 0, 80003, "コッコロ", 152);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", "", 1, 0, 9, 0, 105801, 3, 0, 80003, "ペコリーヌ", 153);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", "", 0, 0, 11, 0, 105901, 3, 0, 80003, "コッコロ", 154);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", "", 1, 0, 10, 0, 105801, 3, 0, 80003, "ペコリーヌ", 155);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", "", 0, 0, 11, 0, 105801, 4, 0, 80003, "ペコリーヌ", 156);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", "", 1, 0, 12, 0, 106001, 4, 0, 80003, "キャル", 157);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", "", 0, 0, 12, 0, 105801, 4, 0, 80003, "ペコリーヌ", 158);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", "", 1, 0, 13, 0, 106001, 4, 0, 80003, "キャル", 159);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", "", 0, 0, 13, 0, 105801, 4, 0, 80003, "ペコリーヌ", 160);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…積極的？\nなんの話よ？", "", 1, 0, 14, 0, 106001, 4, 0, 80003, "キャル", 161);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", "", 0, 0, 14, 0, 105801, 4, 0, 80003, "ペコリーヌ", 162);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", "", 0, 0, 15, 0, 105801, 4, 0, 80003, "ペコリーヌ", 163);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", "", 1, 0, 15, 0, 106001, 4, 0, 80003, "キャル", 164);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", "", 0, 0, 16, 0, 105801, 4, 0, 80003, "ペコリーヌ", 165);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", "", 1, 0, 16, 0, 106001, 4, 0, 80003, "キャル", 166);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", "", 1, 0, 17, 0, 106001, 4, 0, 80003, "キャル", 167);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", "", 0, 0, 18, 0, 106001, 5, 0, 80003, "キャル", 168);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", "", 1, 0, 12, 0, 105901, 5, 0, 80003, "コッコロ", 169);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", "", 0, 0, 19, 0, 106001, 5, 0, 80003, "キャル", 170);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", "", 1, 0, 13, 0, 105901, 5, 0, 80003, "コッコロ", 171);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", "", 0, 0, 20, 0, 106001, 5, 0, 80003, "キャル", 172);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", "", 1, 0, 14, 0, 105901, 5, 0, 80003, "コッコロ", 173);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", "", 0, 0, 21, 0, 106001, 5, 0, 80003, "キャル", 174);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", "", 1, 0, 15, 0, 105901, 5, 0, 80003, "コッコロ", 175);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("かくし芸？", "", 0, 0, 22, 0, 106001, 5, 0, 80003, "キャル", 176);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", "", 1, 0, 16, 0, 105901, 5, 0, 80003, "コッコロ", 177);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", "", 0, 0, 23, 0, 106001, 5, 0, 80003, "キャル", 178);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", "", 0, 0, 17, 0, 105801, 6, 0, 80003, "ペコリーヌ", 179);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", "", 2, 0, 24, 0, 106001, 6, 0, 80003, "キャル", 180);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", "", 1, 0, 17, 0, 105901, 6, 0, 80003, "コッコロ", 181);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", "", 0, 0, 18, 0, 105801, 6, 0, 80003, "ペコリーヌ", 182);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", "", 2, 0, 25, 0, 106001, 6, 0, 80003, "キャル", 183);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", "", 1, 0, 18, 0, 105901, 6, 0, 80003, "コッコロ", 184);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", "", 2, 0, 26, 0, 106001, 6, 0, 80003, "キャル", 185);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", "", 2, 0, 27, 0, 106001, 6, 0, 80003, "キャル", 186);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", "", 2, 0, 28, 0, 106001, 6, 0, 80003, "キャル", 187);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", "", 0, 0, 19, 0, 105801, 6, 0, 80003, "ペコリーヌ", 188);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", "", 1, 0, 19, 0, 105901, 6, 0, 80003, "コッコロ", 189);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", "", 2, 0, 29, 0, 106001, 6, 0, 80003, "キャル", 190);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", "", 0, 0, 30, 0, 106001, 7, 0, 80003, "キャル", 191);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", "", 0, 0, 31, 0, 106001, 7, 0, 80003, "キャル", 192);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", "", 0, 0, 32, 0, 106001, 7, 0, 80003, "キャル", 193);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", "", 0, 0, 33, 0, 106001, 7, 0, 80003, "キャル", 194);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", "", 0, 0, 34, 0, 106001, 7, 0, 80003, "キャル", 195);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("オイッスー☆", "", 0, 0, 35, 0, 106001, 7, 0, 80003, "キャル", 196);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", "", 0, 0, 36, 0, 106001, 7, 0, 80003, "キャル", 197);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", "", 0, 0, 37, 0, 106001, 7, 0, 80003, "キャル", 198);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", "", 0, 0, 38, 0, 106001, 7, 0, 80003, "キャル", 199);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", "", 0, 0, 20, 0, 105901, 8, 0, 80003, "コッコロ", 200);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", "", 0, 0, 21, 0, 105901, 8, 0, 80003, "コッコロ", 201);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", "", 0, 0, 22, 0, 105901, 8, 0, 80003, "コッコロ", 202);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", "", 0, 0, 23, 0, 105901, 8, 0, 80003, "コッコロ", 203);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", "", 0, 0, 24, 0, 105901, 8, 0, 80003, "コッコロ", 204);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("オイッスー☆", "", 0, 0, 25, 0, 105901, 8, 0, 80003, "コッコロ", 205);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", "", 0, 0, 26, 0, 105901, 8, 0, 80003, "コッコロ", 206);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", "", 0, 0, 27, 0, 105901, 8, 0, 80003, "コッコロ", 207);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", "", 0, 0, 28, 0, 105901, 8, 0, 80003, "コッコロ", 208);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("オイッスー☆", "", 0, 0, 20, 0, 105801, 9, 0, 80003, "ペコリーヌ", 209);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", "", 0, 0, 21, 0, 105801, 9, 0, 80003, "ペコリーヌ", 210);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あと６日で2.5周年ですか…", "", 0, 0, 22, 0, 105801, 9, 0, 80003, "ペコリーヌ", 211);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", "", 0, 0, 23, 0, 105801, 9, 0, 80003, "ペコリーヌ", 212);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", "", 0, 0, 24, 0, 105801, 9, 0, 80003, "ペコリーヌ", 213);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("オイッスー☆", "", 0, 0, 25, 0, 105801, 9, 0, 80003, "ペコリーヌ", 214);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", "", 0, 0, 26, 0, 105801, 9, 0, 80003, "ペコリーヌ", 215);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", "", 0, 0, 27, 0, 105801, 9, 0, 80003, "ペコリーヌ", 216);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", "", 0, 0, 28, 0, 105801, 9, 0, 80003, "ペコリーヌ", 217);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", "", 0, 0, 29, 0, 105801, 9, 0, 80003, "ペコリーヌ", 218);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", "", 0, 0, 30, 0, 105801, 9, 0, 80003, "ペコリーヌ", 219);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", "", 0, 0, 31, 0, 105801, 10, 0, 80003, "ペコリーヌ", 220);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", "", 1, 0, 29, 0, 105901, 10, 0, 80003, "コッコロ", 221);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", "", 0, 0, 32, 0, 105801, 10, 0, 80003, "ペコリーヌ", 222);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…………", "", 2, 0, 39, 0, 106001, 10, 0, 80003, "キャル", 223);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", "", 1, 0, 30, 0, 105901, 10, 0, 80003, "コッコロ", 224);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", "", 2, 0, 40, 0, 106001, 10, 0, 80003, "キャル", 225);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", "", 0, 0, 33, 0, 105801, 10, 0, 80003, "ペコリーヌ", 226);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", "", 2, 0, 41, 0, 106001, 10, 0, 80003, "キャル", 227);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", "", 0, 0, 34, 0, 105801, 10, 0, 80003, "ペコリーヌ", 228);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", "", 0, 0, 35, 0, 105801, 10, 0, 80003, "ペコリーヌ", 229);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", "", 2, 0, 42, 0, 106001, 10, 0, 80003, "キャル", 230);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", "", 1, 0, 31, 0, 105901, 10, 0, 80003, "コッコロ", 231);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", "", 2, 0, 43, 0, 106001, 10, 0, 80003, "キャル", 232);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", "", 0, 0, 36, 0, 105801, 10, 0, 80003, "ペコリーヌ", 233);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", "", 0, 0, 6, 0, 190801, 11, 0, 80003, "カリン", 234);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", "", 0, 0, 7, 0, 190801, 11, 0, 80003, "カリン", 235);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", "", 0, 0, 8, 0, 190801, 11, 0, 80003, "カリン", 236);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", "", 0, 0, 9, 0, 190801, 11, 0, 80003, "カリン", 237);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", "", 0, 0, 10, 0, 190801, 11, 0, 80003, "カリン", 238);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", "", 0, 0, 11, 0, 190801, 11, 0, 80003, "カリン", 239);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", "", 0, 0, 12, 0, 190801, 11, 0, 80003, "カリン", 240);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", "", 0, 0, 13, 0, 190801, 11, 0, 80003, "カリン", 241);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あれ？\nもしかして緊張で気を失って…？", "", 0, 0, 14, 0, 190801, 11, 0, 80003, "カリン", 242);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", "", 0, 0, 15, 0, 190801, 11, 0, 80003, "カリン", 243);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", "", 0, 0, 16, 0, 190801, 11, 0, 80003, "カリン", 244);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それでは\nまた明日お会いしましょう♪", "", 0, 0, 17, 0, 190801, 11, 0, 80003, "カリン", 245);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", "", 0, 0, 44, 0, 106001, 12, 0, 80003, "キャル", 246);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", "", 2, 0, 37, 0, 105801, 12, 0, 80003, "ペコリーヌ", 247);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", "", 1, 0, 32, 0, 105901, 12, 0, 80003, "コッコロ", 248);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", "", 0, 0, 45, 0, 106001, 12, 0, 80003, "キャル", 249);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ひどいですよぉキャルちゃ～ん！", "", 2, 0, 38, 0, 105801, 12, 0, 80003, "ペコリーヌ", 250);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", "", 1, 0, 33, 0, 105901, 12, 0, 80003, "コッコロ", 251);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", "", 2, 0, 39, 0, 105801, 12, 0, 80003, "ペコリーヌ", 252);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", "", 0, 0, 46, 0, 106001, 12, 0, 80003, "キャル", 253);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", "", 1, 0, 34, 0, 105901, 12, 0, 80003, "コッコロ", 254);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", "", 2, 0, 40, 0, 105801, 12, 0, 80003, "ペコリーヌ", 255);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", "", 0, 0, 41, 0, 105801, 13, 0, 80003, "ペコリーヌ", 256);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", "", 2, 0, 47, 0, 106001, 13, 0, 80003, "キャル", 257);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("忘れてきちゃいました☆", "", 0, 0, 42, 0, 105801, 13, 0, 80003, "ペコリーヌ", 258);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", "", 2, 0, 48, 0, 106001, 13, 0, 80003, "キャル", 259);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", "", 1, 0, 35, 0, 105901, 13, 0, 80003, "コッコロ", 260);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", "", 2, 0, 49, 0, 106001, 13, 0, 80003, "キャル", 261);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", "", 0, 0, 43, 0, 105801, 13, 0, 80003, "ペコリーヌ", 262);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", "", 2, 0, 50, 0, 106001, 13, 0, 80003, "キャル", 263);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", "", 1, 0, 36, 0, 105901, 13, 0, 80003, "コッコロ", 264);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", "", 2, 0, 51, 0, 106001, 13, 0, 80003, "キャル", 265);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", "", 1, 0, 37, 0, 105901, 13, 0, 80003, "コッコロ", 266);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", "", 2, 0, 52, 0, 106001, 13, 0, 80003, "キャル", 267);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", "", 0, 0, 44, 0, 105801, 13, 0, 80003, "ペコリーヌ", 268);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", "", 1, 0, 38, 0, 105901, 13, 0, 80003, "コッコロ", 269);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", "", 0, 0, 45, 0, 105801, 13, 0, 80003, "ペコリーヌ", 270);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", "", 2, 0, 53, 0, 106001, 13, 0, 80003, "キャル", 271);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", "", 0, 0, 46, 0, 105801, 13, 0, 80003, "ペコリーヌ", 272);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", "", 0, 0, 18, 0, 190801, 14, 0, 80003, "カリン", 273);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("昨日の生放送は\nいかがだったでしょうか？", "", 0, 0, 19, 0, 190801, 14, 0, 80003, "カリン", 274);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", "", 0, 0, 20, 0, 190801, 14, 0, 80003, "カリン", 275);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", "", 0, 0, 21, 0, 190801, 14, 0, 80003, "カリン", 276);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", "", 0, 0, 22, 0, 190801, 14, 0, 80003, "カリン", 277);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", "", 0, 0, 23, 0, 190801, 14, 0, 80003, "カリン", 278);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", "", 0, 0, 24, 0, 190801, 14, 0, 80003, "カリン", 279);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", "", 0, 0, 25, 0, 190801, 14, 0, 80003, "カリン", 280);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", "", 0, 0, 26, 0, 190801, 14, 0, 80003, "カリン", 281);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", "", 0, 0, 27, 0, 190801, 14, 0, 80003, "カリン", 282);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("準備はいいですかっ？\n…いっきますよー！", "", 0, 0, 47, 0, 105801, 15, 0, 80003, "ペコリーヌ", 283);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("祝！", "", 2, 0, 54, 0, 106001, 15, 0, 80003, "キャル", 284);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("2.5周年！", "", 1, 0, 39, 0, 105901, 15, 0, 80003, "コッコロ", 285);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("おめでとうございま～す☆", "", 0, 0, 48, 0, 105801, 15, 0, 80003, "ペコリーヌ", 286);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", "", 2, 0, 55, 0, 106001, 15, 0, 80003, "キャル", 287);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", "", 1, 0, 40, 0, 105901, 15, 0, 80003, "コッコロ", 288);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", "", 0, 0, 49, 0, 105801, 15, 0, 80003, "ペコリーヌ", 289);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", "", 2, 0, 56, 0, 106001, 15, 0, 80003, "キャル", 290);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", "", 1, 0, 41, 0, 105901, 15, 0, 80003, "コッコロ", 291);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", "", 2, 0, 57, 0, 106001, 15, 0, 80003, "キャル", 292);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", "", 0, 0, 50, 0, 105801, 15, 0, 80003, "ペコリーヌ", 293);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", "", 2, 0, 58, 0, 106001, 15, 0, 80003, "キャル", 294);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", "", 0, 0, 51, 0, 105801, 15, 0, 80003, "ペコリーヌ", 295);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("意味分かんないわよ！", "", 2, 0, 59, 0, 106001, 15, 0, 80003, "キャル", 296);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", "", 1, 0, 42, 0, 105901, 15, 0, 80003, "コッコロ", 297);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", "", 1, 0, 43, 0, 105901, 15, 0, 80003, "コッコロ", 298);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", "", 0, 0, 52, 0, 105801, 15, 0, 80003, "ペコリーヌ", 299);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", "", 2, 0, 60, 0, 106001, 15, 0, 80003, "キャル", 300);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", "", 1, 0, 44, 0, 105901, 15, 0, 80003, "コッコロ", 301);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", "", 0, 0, 53, 0, 105801, 15, 0, 80003, "ペコリーヌ", 302);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("2.5周年\nありがとうございます！", "105901,45,106001,61", 0, 0, 54, 1, 105801, 15, 0, 80003, "ペコリーヌ・コッコロ・キャル", 303);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 1, 0, 1, 0, 190804, 0, 1, 60002, "カリン", 304);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 2, 1, 0, 0, 0, 0, 1, 60002, "", 305);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 2, 1, 0, 0, 0, 0, 1, 60002, "", 306);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 2, 1, 0, 0, 0, 0, 1, 60002, "", 307);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 2, 1, 0, 0, 0, 0, 1, 60002, "", 308);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 2, 1, 0, 0, 0, 0, 2, 60002, "", 309);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 2, 2, 0, 0, 0, 0, 1, 60002, "", 310);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 2, 2, 0, 0, 0, 0, 1, 60002, "", 311);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 2, 2, 0, 0, 0, 0, 1, 60002, "", 312);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 2, 2, 0, 0, 0, 0, 1, 60002, "", 313);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 2, 2, 0, 0, 0, 0, 2, 60002, "", 314);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 2, 3, 0, 0, 0, 0, 1, 60002, "", 315);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 2, 3, 0, 0, 0, 0, 1, 60002, "", 316);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 2, 3, 0, 0, 0, 0, 1, 60002, "", 317);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 2, 3, 0, 0, 0, 0, 1, 60002, "", 318);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", "", 2, 3, 0, 0, 0, 0, 1, 60002, "", 319);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 2, 3, 0, 0, 0, 0, 1, 60002, "", 320);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", "", 2, 3, 0, 0, 0, 0, 2, 60002, "", 321);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 2, 4, 0, 0, 0, 0, 1, 60002, "", 322);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 2, 4, 0, 0, 0, 0, 1, 60002, "", 323);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 2, 4, 0, 0, 0, 0, 1, 60002, "", 324);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 2, 4, 0, 0, 0, 0, 1, 60002, "", 325);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 2, 4, 0, 0, 0, 0, 1, 60002, "", 326);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 2, 4, 0, 0, 0, 0, 1, 60002, "", 327);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 2, 4, 0, 0, 0, 0, 2, 60002, "", 328);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 3, 0, 2, 0, 190804, 0, 0, 60002, "カリン", 329);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 3, 0, 3, 0, 190804, 7, 0, 60002, "カリン", 330);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ささ、シェフィさまはこちらへ…", "", 4, 0, 1, 0, 105901, 1, 0, 80005, "コッコロ", 331);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("コッコロさん、どこへ行くの…？\n…え？", "", 0, 0, 1, 0, 106401, 1, 0, 80005, "シェフィ", 332);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", "", 3, 0, 1, 0, 105801, 1, 0, 80005, "ペコリーヌ", 333);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", "", 4, 0, 2, 0, 105901, 1, 0, 80005, "コッコロ", 334);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ええと…\n二人とも何をしているの？", "", 0, 0, 2, 0, 106401, 1, 0, 80005, "シェフィ", 335);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", "", 1, 0, 1, 0, 106001, 1, 0, 80005, "キャル", 336);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あの日…？", "", 0, 0, 3, 0, 106401, 1, 0, 80005, "シェフィ", 337);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", "", 3, 0, 2, 0, 105801, 1, 0, 80005, "ペコリーヌ", 338);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", "", 3, 0, 3, 0, 105801, 1, 0, 80005, "ペコリーヌ", 339);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("やばいですね☆", "", 2, 0, 1, 0, 190801, 1, 0, 80005, "カリン", 340);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("って、なにしれっと\n参加してんのよカリン！", "", 1, 0, 2, 0, 106001, 1, 0, 80005, "キャル", 341);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", "", 2, 0, 2, 0, 190801, 1, 0, 80005, "カリン", 342);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", "", 2, 0, 3, 0, 190801, 1, 0, 80005, "カリン", 343);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", "", 3, 0, 4, 0, 105801, 1, 0, 80005, "ペコリーヌ", 344);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", "", 0, 0, 4, 0, 106401, 1, 0, 80005, "シェフィ", 345);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", "", 3, 0, 5, 0, 105801, 2, 0, 80005, "ペコリーヌ", 346);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", "", 1, 0, 3, 0, 105901, 2, 0, 80005, "コッコロ", 347);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", "", 1, 0, 4, 0, 105901, 2, 0, 80005, "コッコロ", 348);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", "", 3, 0, 6, 0, 105801, 2, 0, 80005, "ペコリーヌ", 349);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("さすがでございます\nペコリーヌさま", "", 1, 0, 5, 0, 105901, 2, 0, 80005, "コッコロ", 350);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", "", 0, 0, 3, 0, 106001, 2, 0, 80005, "キャル", 351);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", "", 2, 0, 5, 0, 106401, 2, 0, 80005, "シェフィ", 352);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", "", 3, 0, 7, 0, 105801, 2, 0, 80005, "ペコリーヌ", 353);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("さ、次はキャルさまの\n番でございますよ", "", 1, 0, 6, 0, 105901, 2, 0, 80005, "コッコロ", 354);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", "", 0, 0, 4, 0, 106001, 2, 0, 80005, "キャル", 355);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", "", 2, 0, 6, 0, 106401, 2, 0, 80005, "シェフィ", 356);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", "", 0, 0, 5, 0, 106001, 2, 0, 80005, "キャル", 357);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", "", 0, 0, 6, 0, 106001, 2, 0, 80005, "キャル", 358);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", "", 1, 0, 7, 0, 105901, 2, 0, 80005, "コッコロ", 359);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", "", 0, 0, 7, 0, 106001, 2, 0, 80005, "キャル", 360);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", "", 1, 0, 8, 0, 105901, 3, 0, 80005, "コッコロ", 361);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", "", 3, 0, 8, 0, 105801, 3, 0, 80005, "ペコリーヌ", 362);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", "", 1, 0, 9, 0, 105901, 3, 0, 80005, "コッコロ", 363);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("聖学祭…って、なにかしら？", "", 2, 0, 7, 0, 106401, 3, 0, 80005, "シェフィ", 364);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", "", 1, 0, 10, 0, 105901, 3, 0, 80005, "コッコロ", 365);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", "", 0, 0, 8, 0, 106001, 3, 0, 80005, "キャル", 366);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", "", 0, 0, 9, 0, 106001, 3, 0, 80005, "キャル", 367);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", "", 3, 0, 9, 0, 105801, 3, 0, 80005, "ペコリーヌ", 368);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("いや、そのまんますぎでしょ…", "", 0, 0, 10, 0, 106001, 3, 0, 80005, "キャル", 369);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", "", 2, 0, 8, 0, 106401, 3, 0, 80005, "シェフィ", 370);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", "", 3, 0, 10, 0, 105801, 3, 0, 80005, "ペコリーヌ", 371);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっ？　ええ…\nぎゅーっ…？", "", 2, 0, 9, 0, 106401, 3, 0, 80005, "シェフィ", 372);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", "", 0, 0, 11, 0, 106001, 4, 0, 80005, "キャル", 373);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", "", 2, 0, 10, 0, 106401, 4, 0, 80005, "シェフィ", 374);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", "", 0, 0, 12, 0, 106001, 4, 0, 80005, "キャル", 375);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", "", 1, 0, 11, 0, 105901, 4, 0, 80005, "コッコロ", 376);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", "", 0, 0, 13, 0, 106001, 4, 0, 80005, "キャル", 377);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", "", 3, 0, 11, 0, 105801, 4, 0, 80005, "ペコリーヌ", 378);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", "", 0, 0, 14, 0, 106001, 4, 0, 80005, "キャル", 379);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", "", 0, 0, 15, 0, 106001, 4, 0, 80005, "キャル", 380);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", "", 2, 0, 11, 0, 106401, 4, 0, 80005, "シェフィ", 381);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", "", 3, 0, 12, 0, 105801, 4, 0, 80005, "ペコリーヌ", 382);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", "", 1, 0, 12, 0, 105901, 4, 0, 80005, "コッコロ", 383);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", "", 0, 0, 16, 0, 106001, 4, 0, 80005, "キャル", 384);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", "", 2, 0, 12, 0, 106401, 4, 0, 80005, "シェフィ", 385);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", "", 3, 0, 13, 0, 105801, 5, 0, 80005, "ペコリーヌ", 386);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", "", 3, 0, 14, 0, 105801, 5, 0, 80005, "ペコリーヌ", 387);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", "", 3, 0, 15, 0, 105801, 5, 0, 80005, "ペコリーヌ", 388);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", "", 0, 0, 17, 0, 106001, 5, 0, 80005, "キャル", 389);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", "", 0, 0, 18, 0, 106001, 5, 0, 80005, "キャル", 390);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", "", 2, 0, 13, 0, 106401, 5, 0, 80005, "シェフィ", 391);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", "", 1, 0, 13, 0, 105901, 5, 0, 80005, "コッコロ", 392);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", "", 3, 0, 16, 0, 105801, 5, 0, 80005, "ペコリーヌ", 393);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", "", 0, 0, 19, 0, 106001, 5, 0, 80005, "キャル", 394);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", "", 3, 0, 17, 0, 105801, 5, 0, 80005, "ペコリーヌ", 395);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", "", 3, 0, 18, 0, 105801, 5, 0, 80005, "ペコリーヌ", 396);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", "", 3, 0, 19, 0, 105801, 5, 0, 80005, "ペコリーヌ", 397);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", "", 2, 0, 4, 0, 190801, 6, 0, 80005, "カリン", 398);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", "", 2, 0, 5, 0, 190801, 6, 0, 80005, "カリン", 399);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…えっ！？", "", 1, 0, 20, 0, 106001, 6, 0, 80005, "キャル", 400);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", "", 3, 0, 20, 0, 105801, 6, 0, 80005, "ペコリーヌ", 401);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", "", 0, 0, 14, 0, 106401, 6, 0, 80005, "シェフィ", 402);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", "", 4, 0, 14, 0, 105901, 6, 0, 80005, "コッコロ", 403);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", "", 0, 0, 15, 0, 106401, 6, 0, 80005, "シェフィ", 404);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", "", 1, 0, 21, 0, 106001, 6, 0, 80005, "キャル", 405);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", "", 3, 0, 21, 0, 105801, 6, 0, 80005, "ペコリーヌ", 406);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ぶっ殺すぞ！？", "", 1, 0, 22, 0, 106001, 6, 0, 80005, "キャル", 407);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", "", 2, 0, 6, 0, 190801, 6, 0, 80005, "カリン", 408);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", "", 1, 0, 15, 0, 105901, 7, 0, 80005, "コッコロ", 409);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", "", 0, 0, 23, 0, 106001, 7, 0, 80005, "キャル", 410);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", "", 2, 0, 16, 0, 106401, 7, 0, 80005, "シェフィ", 411);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", "", 3, 0, 22, 0, 105801, 7, 0, 80005, "ペコリーヌ", 412);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", "", 0, 0, 24, 0, 106001, 7, 0, 80005, "キャル", 413);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", "", 2, 0, 17, 0, 106401, 7, 0, 80005, "シェフィ", 414);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", "", 1, 0, 16, 0, 105901, 7, 0, 80005, "コッコロ", 415);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", "", 2, 0, 18, 0, 106401, 7, 0, 80005, "シェフィ", 416);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", "", 1, 0, 17, 0, 105901, 7, 0, 80005, "コッコロ", 417);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("しれっと教育ママが\n生まれてる…？", "", 0, 0, 25, 0, 106001, 7, 0, 80005, "キャル", 418);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", "", 3, 0, 23, 0, 105801, 7, 0, 80005, "ペコリーヌ", 419);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("え～～～～！？", "", 0, 0, 26, 0, 106001, 7, 0, 80005, "キャル", 420);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", "", 0, 0, 27, 0, 106001, 8, 0, 80005, "キャル", 421);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", "", 2, 0, 19, 0, 106401, 8, 0, 80005, "シェフィ", 422);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", "", 1, 0, 18, 0, 105901, 8, 0, 80005, "コッコロ", 423);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", "", 3, 0, 24, 0, 105801, 8, 0, 80005, "ペコリーヌ", 424);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", "", 2, 0, 20, 0, 106401, 8, 0, 80005, "シェフィ", 425);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", "", 0, 0, 28, 0, 106001, 8, 0, 80005, "キャル", 426);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", "", 1, 0, 19, 0, 105901, 8, 0, 80005, "コッコロ", 427);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", "", 2, 0, 21, 0, 106401, 8, 0, 80005, "シェフィ", 428);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", "", 0, 0, 29, 0, 106001, 8, 0, 80005, "キャル", 429);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", "", 0, 0, 30, 0, 106001, 8, 0, 80005, "キャル", 430);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", "", 3, 0, 25, 0, 105801, 8, 0, 80005, "ペコリーヌ", 431);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", "", 0, 0, 31, 0, 106001, 8, 0, 80005, "キャル", 432);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", "", 0, 0, 22, 0, 106401, 9, 0, 80005, "シェフィ", 433);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", "", 0, 0, 23, 0, 106401, 9, 0, 80005, "シェフィ", 434);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", "", 0, 0, 24, 0, 106401, 9, 0, 80005, "シェフィ", 435);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", "", 0, 0, 25, 0, 106401, 9, 0, 80005, "シェフィ", 436);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", "", 0, 0, 26, 0, 106401, 9, 0, 80005, "シェフィ", 437);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", "", 0, 0, 27, 0, 106401, 9, 0, 80005, "シェフィ", 438);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("―びえぇぇ～んっ！！！", "", 0, 0, 28, 0, 106401, 9, 0, 80005, "シェフィ", 439);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("どうされましたか、シェフィさま", "", 1, 0, 20, 0, 105901, 9, 0, 80005, "コッコロ", 440);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ううっ…ひっく…\nママッ…！", "", 0, 0, 29, 0, 106401, 9, 0, 80005, "シェフィ", 441);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", "", 1, 0, 21, 0, 105901, 9, 0, 80005, "コッコロ", 442);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", "", 1, 0, 22, 0, 105901, 9, 0, 80005, "コッコロ", 443);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", "", 0, 0, 30, 0, 106401, 9, 0, 80005, "シェフィ", 444);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("主さま\n3.5周年まであと５日\nでございます", "", 0, 0, 23, 0, 105901, 10, 0, 80005, "コッコロ", 445);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ですがその前に\n生放送がありますね", "", 0, 0, 24, 0, 105901, 10, 0, 80005, "コッコロ", 446);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…生放送に向けた\n意気込みでございますか？", "", 0, 0, 25, 0, 105901, 10, 0, 80005, "コッコロ", 447);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", "", 0, 0, 26, 0, 105901, 10, 0, 80005, "コッコロ", 448);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", "", 0, 0, 27, 0, 105901, 10, 0, 80005, "コッコロ", 449);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", "", 0, 0, 28, 0, 105901, 10, 0, 80005, "コッコロ", 450);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", "", 0, 0, 29, 0, 105901, 10, 0, 80005, "コッコロ", 451);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", "", 0, 0, 30, 0, 105901, 10, 0, 80005, "コッコロ", 452);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", "", 0, 0, 31, 0, 105901, 10, 0, 80005, "コッコロ", 453);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと４日！\nやばいですね☆", "", 0, 0, 26, 0, 105801, 11, 0, 80005, "ペコリーヌ", 454);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", "", 1, 0, 32, 0, 106001, 11, 0, 80005, "キャル", 455);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", "", 0, 0, 27, 0, 105801, 11, 0, 80005, "ペコリーヌ", 456);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", "", 0, 0, 28, 0, 105801, 11, 0, 80005, "ペコリーヌ", 457);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", "", 0, 0, 29, 0, 105801, 11, 0, 80005, "ペコリーヌ", 458);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", "", 1, 0, 33, 0, 106001, 11, 0, 80005, "キャル", 459);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", "", 0, 0, 30, 0, 105801, 11, 0, 80005, "ペコリーヌ", 460);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", "", 0, 0, 31, 0, 105801, 11, 0, 80005, "ペコリーヌ", 461);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", "", 0, 0, 32, 0, 105801, 11, 0, 80005, "ペコリーヌ", 462);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("だからあたしはやるなんて一言も…", "", 1, 0, 34, 0, 106001, 11, 0, 80005, "キャル", 463);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("オイッスー☆", "", 0, 0, 33, 0, 105801, 11, 0, 80005, "ペコリーヌ", 464);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("聞きなさいっての！！", "", 1, 0, 35, 0, 106001, 11, 0, 80005, "キャル", 465);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", "", 2, 0, 31, 0, 106401, 12, 0, 80005, "シェフィ", 466);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", "", 2, 0, 32, 0, 106401, 12, 0, 80005, "シェフィ", 467);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", "", 2, 0, 33, 0, 106401, 12, 0, 80005, "シェフィ", 468);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", "", 2, 0, 34, 0, 106401, 12, 0, 80005, "シェフィ", 469);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", "", 2, 0, 35, 0, 106401, 12, 0, 80005, "シェフィ", 470);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("やってますねシェフィちゃん！", "", 3, 0, 34, 0, 105801, 12, 0, 80005, "ペコリーヌ", 471);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なによ、考えることは\nみんな同じってこと？", "", 0, 0, 36, 0, 106001, 12, 0, 80005, "キャル", 472);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", "", 1, 0, 32, 0, 105901, 12, 0, 80005, "コッコロ", 473);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("みんな…もちろんよ！", "", 2, 0, 36, 0, 106401, 12, 0, 80005, "シェフィ", 474);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", "", 3, 0, 35, 0, 105801, 12, 0, 80005, "ペコリーヌ", 475);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", "", 2, 0, 7, 0, 190801, 13, 0, 80005, "カリン", 476);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", "", 2, 0, 8, 0, 190801, 13, 0, 80005, "カリン", 477);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", "", 3, 0, 36, 0, 105801, 13, 0, 80005, "ペコリーヌ", 478);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", "", 2, 0, 9, 0, 190801, 13, 0, 80005, "カリン", 479);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", "", 4, 0, 33, 0, 105901, 13, 0, 80005, "コッコロ", 480);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", "", 2, 0, 10, 0, 190801, 13, 0, 80005, "カリン", 481);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", "", 1, 0, 37, 0, 106001, 13, 0, 80005, "キャル", 482);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", "", 2, 0, 11, 0, 190801, 13, 0, 80005, "カリン", 483);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あうー？", "", 0, 0, 37, 0, 106401, 13, 0, 80005, "シェフィ", 484);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("あ…", "105901,34,106001,38,190801,12", 4, 0, 37, 1, 105801, 13, 0, 80005, "みんな", 485);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", "", 1, 0, 39, 0, 106001, 13, 0, 80005, "キャル", 486);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", "", 4, 0, 35, 0, 105901, 13, 0, 80005, "コッコロ", 487);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", "", 3, 0, 38, 0, 105801, 13, 0, 80005, "ペコリーヌ", 488);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", "", 2, 0, 13, 0, 190801, 13, 0, 80005, "カリン", 489);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", "", 2, 0, 38, 0, 106401, 14, 0, 80005, "シェフィ", 490);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", "", 3, 0, 39, 0, 105801, 14, 0, 80005, "ペコリーヌ", 491);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", "", 0, 0, 40, 0, 106001, 14, 0, 80005, "キャル", 492);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", "", 1, 0, 36, 0, 105901, 14, 0, 80005, "コッコロ", 493);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", "", 2, 0, 39, 0, 106401, 14, 0, 80005, "シェフィ", 494);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", "", 3, 0, 40, 0, 105801, 14, 0, 80005, "ペコリーヌ", 495);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", "", 1, 0, 37, 0, 105901, 14, 0, 80005, "コッコロ", 496);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", "", 0, 0, 41, 0, 106001, 14, 0, 80005, "キャル", 497);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("へ、へぇ…", "", 2, 0, 40, 0, 106401, 14, 0, 80005, "シェフィ", 498);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", "", 3, 0, 41, 0, 105801, 14, 0, 80005, "ペコリーヌ", 499);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", "", 2, 0, 41, 0, 106401, 14, 0, 80005, "シェフィ", 500);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", "", 2, 0, 42, 0, 106401, 14, 0, 80005, "シェフィ", 501);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", "", 3, 0, 42, 0, 105801, 15, 0, 80005, "ペコリーヌ", 502);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("祝！", "", 1, 0, 42, 0, 106001, 15, 0, 80005, "キャル", 503);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("3.5周年！", "", 4, 0, 38, 0, 105901, 15, 0, 80005, "コッコロ", 504);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("おめでとうございます！", "", 0, 0, 43, 0, 106401, 15, 0, 80005, "シェフィ", 505);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", "", 2, 0, 14, 0, 190801, 15, 0, 80005, "カリン", 506);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", "", 2, 0, 15, 0, 190801, 15, 0, 80005, "カリン", 507);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", "", 3, 0, 43, 0, 105801, 15, 0, 80005, "ペコリーヌ", 508);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", "", 3, 0, 44, 0, 105801, 15, 0, 80005, "ペコリーヌ", 509);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", "", 1, 0, 43, 0, 106001, 15, 0, 80005, "キャル", 510);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", "", 1, 0, 44, 0, 106001, 15, 0, 80005, "キャル", 511);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", "", 0, 0, 44, 0, 106401, 15, 0, 80005, "シェフィ", 512);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", "", 0, 0, 45, 0, 106401, 15, 0, 80005, "シェフィ", 513);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", "", 4, 0, 39, 0, 105901, 15, 0, 80005, "コッコロ", 514);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", "", 4, 0, 40, 0, 105901, 15, 0, 80005, "コッコロ", 515);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", "", 4, 0, 41, 0, 105901, 15, 0, 80005, "コッコロ", 516);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", "", 3, 0, 45, 0, 105801, 15, 0, 80005, "ペコリーヌ", 517);
